webpackJsonp([0x987e303f4e16],{485:function(e,t){e.exports={data:{markdownRemark:{html:'<p>The first computer I ever used was a Macintosh Classic.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 89.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="mac classic"\n        title=""\n        src="/static/Macintosh_classic-a6c9694ab2d4e93f6bb4d9424b860094-4fe5d.png"\n        srcset="/static/Macintosh_classic-a6c9694ab2d4e93f6bb4d9424b860094-0808b.png 148w,\n/static/Macintosh_classic-a6c9694ab2d4e93f6bb4d9424b860094-d670b.png 295w,\n/static/Macintosh_classic-a6c9694ab2d4e93f6bb4d9424b860094-4fe5d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>This was during the first rise when if you wanted a computer that works then you had to get a Mac, so that’s what we had at home.</p>\n<p>I don’t remember anything about using it, just where it was in the house, but I hate to think what I might have become if that had been an IBM or whatever other home “computers” were available at the time because I believe that thanks to that first contact with a computer done right sparked my interest in technology, you can apply the same logic to the fact that my first t shirt had a skateboarder on it.</p>\n<p>It was a long time until I encountered another Apple product and that story has already been told, but every single new product gave me that spark all over again, possibilities increased tremendously by a product that at a glance is no different than the competition.</p>\n<p>But it is different, you can see the care that went into it, the unstopping quest for perfection and ease of use.</p>\n<p>It’s hard to explain, but you can feel the difference just by thinking about the product, be it an iPod, iPhone, iPad or Mac.</p>\n<p>That difference is Steve Jobs.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 237px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 172.99578059071732%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="steve jobs"\n        title=""\n        src="/static/steve_jobs-c80ea720e9c08194921fb651ddf987c8-752ce.png"\n        srcset="/static/steve_jobs-c80ea720e9c08194921fb651ddf987c8-b65d2.png 148w,\n/static/steve_jobs-c80ea720e9c08194921fb651ddf987c8-752ce.png 237w"\n        sizes="(max-width: 237px) 100vw, 237px"\n      />\n    </span>\n  </span>\n  </p>',frontmatter:{date:"October 06, 2011",path:"/back-to-the-start.html",tags:["tag"],title:"Back to the start",image:{childImageSharp:{resize:{src:"/static/balloons-4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"Today is the opening day of the Apple Store here in Valencia.\nIt’s also a landmark for Spain as the first store following Apples tradition of acquiring a locale of distinguished antiquity and renovating it. It’s located on the main shopping street of…",html:'<p>Today is the opening day of the Apple Store here in Valencia.\nIt’s also a landmark for Spain as the first store following Apples tradition of acquiring a locale of distinguished antiquity and renovating it.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.27586206896552%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="apple store"\n        title=""\n        src="/static/IMG_20111203_125212-768x1024-dff39a6f675727453ec904416c1d5b23-7ee4f.png"\n        srcset="/static/IMG_20111203_125212-768x1024-dff39a6f675727453ec904416c1d5b23-785d5.png 148w,\n/static/IMG_20111203_125212-768x1024-dff39a6f675727453ec904416c1d5b23-2f066.png 295w,\n/static/IMG_20111203_125212-768x1024-dff39a6f675727453ec904416c1d5b23-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It’s located on the main shopping street of colon a place that is always bustling with people so they have done, as always, a great job on positioning themselves.</p>\n<p>But I’m not here to talk about the shop, I didn’t even go inside and that’s what this is about.</p>\n<p>To begin with there was a line that went right around the block, for a shop! even if there hadn’t been a line I doubt I would have gone in as the place was packed as it is, now I just can’t understand the why, these products are already sold everywhere, everyone has used all these products before, so why the hysteria? And it’s not that people just want to have a play, 1 out of 3 were walking out having bought something, seriously does simply opening a store mean people will automatically decide to start buying Apple products?</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="apple store line"\n        title=""\n        src="/static/IMG_20111203_125308-1024x768-22e23ad7298f33450079940af0d6fe95-7ee4f.png"\n        srcset="/static/IMG_20111203_125308-1024x768-22e23ad7298f33450079940af0d6fe95-785d5.png 148w,\n/static/IMG_20111203_125308-1024x768-22e23ad7298f33450079940af0d6fe95-2f066.png 295w,\n/static/IMG_20111203_125308-1024x768-22e23ad7298f33450079940af0d6fe95-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>And don’t start thinking “oh well they must have been having opening specials” no, Apple hasn’t and never will have opening day specials, this mass of people outweighing any sales that I’ve seen are here because…well I don’t know why they’re there. It was hard not to laugh at the whole thing, watching the employees high five everyone as they were herded in, people walking around wide eyed at products that have been available from months to years. And it didn’t take me long to deduce something from all this, these are those same people that click on google ads, those people that obey orders that you and I can’t see, I actually found them, they exist.</p>',id:"/home/circleci/repo/posts/2011-12-03-i-found-them/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2011-12-03T12:00:00+00:00",path:"/i-found-them.html",tags:["tag"],title:"I found them"}},next:{excerpt:"It won’t be long until I’ll seriously consider disconnecting from the internet and never coming back for fear of imprisonment. Nearly all the isps that have instated 3 strikes and you’re out policies are under investigation after all the people who…",html:'<p>It won’t be long until I’ll seriously consider disconnecting from the internet and never coming back for fear of imprisonment.</p>\n<ul>\n<li>\n<p>Nearly all the isps that have instated 3 strikes and you’re out policies are under investigation after all the people who received such warnings had never file shared in their life, don’t leave your wifis open people.</p>\n</li>\n<li>\n<p>A Canadian was fined 60.000$ for sharing 2 adult films online….2.</p>\n</li>\n<li>\n<p>The British admin of tv shack, a link sharing site not actually hosting any infringing content and probably not even one of the uploaders, is going to be extradited to the U.S. to be charged there….extradited, I remember when that word only came up with terrorists or mastermind thieves not 23 year old students running a site that doesn’t host any infringing material.</p>\n</li>\n<li>\n<p>Someone was fined 80.000$ when he downloaded an adult movie disguised as out of copyright classical music, something that has happened to all of us I’m sure, begs to ask who posted the disguised file in the first place.</p>\n</li>\n<li>\n<p>In the U.S. they’re hoping to pass a law that will make it a felon to embed copyrighted content, see a video you like on youtube and you embed it on your blog which then turns out to be infringing copyright and that will be a felon, do some graffiti, go skateboarding and run a blog and you’re looking at life.</p>\n</li>\n</ul>\n<p>Now the scary thing is these stories are from this week alone.</p>\n<p>And the worst part is all the lawyers and companies carrying out these acts are all linked in some way to having commited piracy themselves or to be operating outside the law.</p>\n<p>If you ever receive a letter demanding money because you allegedly infringed copyright, it was probably sent by a firm like Davenport Lyons who were just found guilty of professional misconduct so the tides may be changing on that front but when the notorious acs law firm shuts it’s doors after being threatened with a possible 600.000 pound fine if found guilty just to have it lowered to 800 pounds seeing as the owner now doesn’t have the means for a larger fine, the same owner who goes home to his 700.000 pound house and 2 luxury cars.</p>\n<p>It looks like a scary future for internet users as long as it continues to be unknown what is ok and what will land us in jail.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 31.03448275862069%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="copyright"\n        title=""\n        src="/static/copyright-comic-75821e2571f287b5eca46fd5ec65e32b-7ee4f.png"\n        srcset="/static/copyright-comic-75821e2571f287b5eca46fd5ec65e32b-785d5.png 148w,\n/static/copyright-comic-75821e2571f287b5eca46fd5ec65e32b-2f066.png 295w,\n/static/copyright-comic-75821e2571f287b5eca46fd5ec65e32b-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Thanks to <a href="http://mimiandeunice.com/">mimiandeunice</a> for the great comic and their ♡copyheart stance meaning I didn’t even have to ask permission, sharing is caring.</p>',id:"/home/circleci/repo/posts/2011-06-21-just-an-average-internet-criminal/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2011-06-21T12:00:00+00:00",path:"/just-an-average.html",tags:["tag"],title:"Just an average internet criminal"}}}}}});
